//参考--前缀和=字母-1--数字+1
function findLongestSubarray(array: string[]): string[] {
  const Len = array.length
  const sum: number[] = [0]
  //为什么要先加个零
  //什么都没有的时候应该为0，保证["A", "1"]通过
  let _char = 0
  let _num = 0
  for (let i = 0; i < array.length; i++) {
    if (/^\d+$/.test(array[i])) {
      _num++
    } else {
      _char++
    }
    sum.push(_num - _char)
  }
  const map: Map<number, Array<number>> = new Map()
  //[min,max]
  for (let i = 0; i < sum.length; i++) {
    const curr = sum[i]
    if (map.has(curr)) {
      let temp: number[] = map.get(curr)!
      temp[1] = i
    } else {
      map.set(curr, [i, i])
    }
  }
  let left = array.length
  let right = 0
  for (const [key, [min, max]] of map) {
    if (max - min > right - left) {
      left = min
      right = max
    }
    else if (max - min === right - left && min < left) {
      left = min
      right = max
    }
  }
  return array.slice(left, right)
};

